import styled from 'styled-components'

// Create a Title component that'll render an <h1> tag with some styles
const MidleContainerStyle = styled.div`
  width: 70%;
  height: 100%;
  background-color: lightgreen;
  z-index: 0;
`;


export default MidleContainerStyle;
